import React, {useState, useEffect} from "react";
import { csv } from "d3-fetch";

const recommend = (answers) => {
    const [data, setData] = useState();
    useEffect(() => {
        csv("../../dataset/dummy_data.csv").then(data => {
            setData(data);
        });
    }, [])
    console.log(data)
    return ( "1" );
}
 
export default recommend;
